//images
import Logo from '../assets/logo.svg'

const Header = () => {
  return (
    <header className='bg-pink-300' py-8>Header
      <div className='py-8'>
        <div className='container mx-auto'>
          {/* logo */}
          <a href='#'>
            <img src='{Logo}'></img>
          </a>
        </div>
      </div>
    </header>
  );
};

export default Header;
